import React, { useState, useEffect } from 'react';
import axios from "axios"

const App = () => {

    useEffect(() => {
        axios.get("http://127.0.0.1:5000/").then((response) => {
            console.log(response.data);
        });
    });

    axios.get("http://127.0.0.1:5000/");

    return (
        <div>
        response.data
        </div>
    );
}

export default App;
